Mauritius flavours at the resort
Mauritian gastronomy holds no secrets for the bold chefs at the restaurants of the chic Sugar Beach. Inspired by the idyllic surroundings of the hotel, they never tire of reinterpreting typically Mauritian recipes and changing perceptions. If each dish is a delight for the taste buds, then the presentation is also a feast for the eyes. The cuisine on offer at the Tides restaurant is delicious and far exceeds the expectations of even the most demanding gourmets. With an atmosphere that is both contemporary and casual, this is a delightfully original kitchen, with its feet firmly in the white sand. Truly a stunning setting for your Mauritius holiday, in gastronomic heaven.
